Aplicatia CRAFT ofera clientilor posibilitatea de a comanda cu usurinta produsele dorite:
1. Selectati unde doriti sa se faca livrarea;
2. Alegeti produsele si cantitatea;
3. Selectati cand doriti livrarea si modalitatea de plata.

Principalul obiectiv al aplicației APPETITO este să vă ofere posibilitatea utilizării unui serviciu de comenzi online de mâncare, prin care să aveți acces la produsele partenerilor noștri economisind timp în procesul de căutare a meniului dorit și de plasare și recepționare a comenzii. 

Bucurați-vă de meniul nostru descărcând aplicația acum!

Descarcă Aplicația APPETITO și vei beneficia de:

▶ Posibilitatea plasării unei comenzi în câțiva pași rapizi și ușori din meniul nostru;
▶ Meniu diversificat;
▶ Livrarea comenzii tale până la ușă;
▶ Filtre care să ușureze plasarea unei comenzi;
▶ Opțiunea de pick-up – ridicarea personală a comenzii din restaurant.

Cum funcționează?

După descărcarea aplicației trebuie să vă creați un cont prin introducerea numelui, adresei de e-mail și a numărului de telefon sau conectare cu Facebook. După aceea, singurul lucru care rămâne de făcut, este să plasezi o comandă! Pentru aceasta, trebuie să alegi restaurantul și produsele pe care vrei să le comanzi, să le adaugi în coș și să treci adresa unde urmează să fie livrată comanda. Plata comenzii se va face numerar la momentul livrării. 

Poftă bună!

Descărcarea aplicației este gratuită.

Dacă îți place aplicația noastră, te rugăm să ne lași o recenzie! De asemenea, dacă vrei să ne lași un feedback pentru îmbunătățirea aplicației noastre te rugăm să ne trimiți un mail la adresa contact@appetito.ro și îți vom răspunde în cel mai scurt timp!
